import React from 'react';

const RestuCreate = () => {
    return (
        <>
        <section className="container">
            <div className="row">
              <div>
                <h3 className="text-center success">Restaurant Create</h3>
             </div>
            </div>
        </section>
        </>
    )
};

export default RestuCreate;
